import React, { useEffect, useState } from 'react';
import axios from 'axios';

const api = 'http://localhost:3001/api/filials';

const MetroStations = ({ initialStationName = '', initialStationColor = '' }) => {
  const [stations, setStations] = useState([]);
  const [searchText, setSearchText] = useState('');
  const [selectedStation, setSelectedStation] = useState({
    name: initialStationName,
    color: initialStationColor,
  });
  const [formData, setFormData] = useState({
    name: '',
    address: '',
    metro: initialStationName,
    metro_color: initialStationColor,
    price: '',
    tel: '',
    comment: ''
  });

  useEffect(() => {
    const fetchStations = async () => {
      const response = await fetch('https://overpass-api.de/api/interpreter', {
        method: 'POST',
        body: `
          [out:json];
          area[name="Москва"]->.searchArea;
          node["railway"="station"](area.searchArea);
          out body;
        `,
      });
      const data = await response.json();
      const stations = data.elements.map(element => ({
        id: element.id,
        name: element.tags.name,
        line: element.tags['railway:ref'],
        color: element.tags['colour'],
      }));
      setStations(stations);
    };

    fetchStations();
  }, []);

  const filteredStations = stations.filter(station =>
    station.name.toLowerCase().includes(searchText.toLowerCase())
  );

  const handleStationSelect = (station) => {
    setSelectedStation({ name: station.name, color: station.color });
    setSearchText(station.name);
    setFormData({ ...formData, metro: station.name, metro_color: station.color });
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(api, formData);
      console.log('Response:', response.data);
      // Clear form or show success message
    } catch (error) {
      console.error('Error submitting form:', error);
    }
  };

  return (
    <div className="card-main pd20">
      <h1>Добавить новый филиал</h1>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Название:</label>
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Адрес:</label>
          <input
            type="text"
            name="address"
            value={formData.address}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Станция метро:</label>
          <input
            type="text"
            value={searchText}
            onChange={(e) => setSearchText(e.target.value)}
          />
          {searchText && (
            <ul className="suggestions-list">
              {filteredStations.map(station => (
                <li
                  key={station.id}
                  onClick={() => handleStationSelect(station)}
                  className="suggestion-item"
                >
                  <span
                    className="color-circle"
                    style={{ backgroundColor: station.color }}
                  ></span>
                  {station.name}
                </li>
              ))}
            </ul>
          )}
        </div>
        <div className="form-group">
          <label>Цена:</label>
          <input
            type="text"
            name="price"
            value={formData.price}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Телефон:</label>
          <input
            type="text"
            name="tel"
            value={formData.tel}
            onChange={handleInputChange}
            required
          />
        </div>
        <div className="form-group">
          <label>Комментарий:</label>
          <textarea
            name="comment"
            value={formData.comment}
            onChange={handleInputChange}
          />
        </div>
        <button type="submit" className="submit-button">Отправить</button>
      </form>
      <div className="selected-station">
        <h2>Вы выбрали станцию:</h2>
        {selectedStation.name && (
          <div className="station-info">
            <span
              className="color-circle"
              style={{ backgroundColor: selectedStation.color }}
            ></span>
            {selectedStation.name}
          </div>
        )}
      </div>
    </div>
  );
};

export default MetroStations;
